import logo from "./logo.svg";
import "./App.css";
import Dashboard from "./component/Dashboard";
import AccountCreation from "./component/AccountCreation";
import AccountEntitlement from "./component/AccountEntitlement";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import HeaderComponent from "./component/HeaderComponent";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <HeaderComponent />
        <div className="container">
          <Route path="/creation" exact element={<AccountCreation />}></Route>
          <Route path="/entitlement" component={<AccountEntitlement />}></Route>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
